column13:
An ambulatory monitor for monitoring the action of a pacemaker and the cardiac response of a patient fitted with a pacemaker comprises detection electrodes (1,2) coupled to the patient for detecting pacemaker pulses and cardiac responses; an analyser (5) connected to the detection electrodes for
 a) analysing the relationship between the detected pacemaker impulses and cardiac responses, b) analysing the shape and timing of the cardiac responses, and c) generating corresponding data signals; 
and a recorder (8) for recording the data signals.
